import React from "react";
import Form from '../components/Check/ValidForm';

function FormItem(props) {

    let template = {
        title: 'Test Crud',
        fields: [
            {
                title: 'First Name',
                type: 'text',
                name: 'firstname',
            },
            {
                title: 'Description',
                type: 'text',
                name: 'description',
                
            },
            {
                title: 'Url image',
                type: 'url',
                name: 'urlimage'
            },
        ]
    }

    return (
        <Form
            template={template}
            onSubmit={onSubmit}
        />
    );
}


function onSubmit(values) {
    console.log(values);
}


export default FormItem;
